import React from 'react';
import {  StyleSheet, Image } from 'react-native';
import { View } from './Themed';

function Gallery({props}) {

    console.log('propsGallery', props)

    return (
        <>
        {Object.values(props).map((pic, index) => {
            return (
                <>
                <Image
                style={styles.image}
                source={{uri: `${pic.url}`}}
                key={pic.assetId}
                >
                </Image>
                <View key={pic.publicId} style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
                </>
            )}
            )}
        </>
    )}

    const styles = StyleSheet.create ({
        image: {
            flex: 1,
            width: 300,
            height: 300,
            margin: 10,
        },
        separator: {
            marginVertical: 30,
            height: 1,
            width: '80%',
          },
    });

    export default Gallery;
